import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;
@GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.LKMSqlToHive_SQOOP")	
public class LKM_SQL_to_Hive_SQOOP extends HiveSqoopImportBaseLKM {

    // class constructor; initialization is done in setBinding method
    public LKM_SQL_to_Hive_SQOOP() {}

    // Declare KM level vars        
    protected boolean  option_DELETE_TEMPORARY_OBJECTS

    public void setBinding( Binding binding ) {
        super.setBinding( binding )
        // Initialize variables
        option_DELETE_TEMPORARY_OBJECTS                     = isOptionTrue( "DELETE_TEMPORARY_OBJECTS" )
    }

    void updateBinding() {
        super.updateBinding()
        // Publish variables into binding to make them available in templates and variableDefText
        mBinding.setVariable( "DELETE_TEMPORARY_OBJECTS", option_DELETE_TEMPORARY_OBJECTS )                     
    }

    @ASTProducerMethod(processingType=ProcessingType.SOURCE, producedASTType=SqlQuery.class, styleKey="ProcessingStyleKey.SQL.SELECT")
    public AbstractSyntaxTree SELECT() {
      return LKM_SQL_to_SQL_v2__SELECT()
    }

    @ASTProducerMethod(processingType=ProcessingType.TARGET, producedASTType=NullTarget.class, styleKey="ProcessingStyleKey.Hive.INSERT")      
    public AbstractSyntaxTree INSERT( SqlQuery input ) {              
        setSqoopQuery( getTgtSelectQuery( input ) )

        // Create DDL for staging table
        def stagingTable = getStagingTable()
        stgTableAST = new HiveCreateTableStatement( "abc", "def", stagingTable, getHiveTechnology(), ffFinder )
        def stgTableColumnList = physicalNode.getPhysicalColumns().collect { physCol -> return Column.getColumn( stagingTable, physCol) }

        // JRN columns are not needed in C$ table. So we do not need to add these virtual columns
        /*
        def jrnInfo = generatorContext.getJRNInfo()
        if (jrnInfo != null && jrnInfo.hasJrn()) 
            stgTableColumnList = stgTableColumnList.plus( jrnInfo.getJRNVirtualColumns() )
        */
        stgTableAST.setColumns( stgTableColumnList )                

        // Publish variables into binding to make them available in templates and variableDefText
        updateBinding()
        return new NullTarget()
    }

} // End of class definition
